        "metaTagDescription": "Capture and share every heart-pounding, cliff-dropping, thrill-seeking moment on the optically-brilliant Sony Action Cam Wearable Camcorder with built-in Wi-Fi®. \n\nWeighs in at just 3.2 oz. with battery so you can capture your adventures on the mountain, in the water and anywhere else you go for your adrenaline fixes \nAction Cam includes a rugged, waterproof housing with tripod mount; camera is waterproof down to 60m (197 ft.), and is nearly impervious to mud, snow and grime Ultra-wide-angle Carl Zeiss® Tessar® F2.8 lens offers amazing optics; 170° viewing angle ensures it's not just you in the picture but everything around you Camera features built-in Wi-Fi, image stabilizer and high-definition recording with 1920 x 1080 at 30 fps and 1280 x 720 at 60 fps\nHD Slow 2x and HD Slow 4x lets you slow it all down; ideal for studying and refining form and technique \nFull high definition resolution lets you capture every kicked-up rock and every drop of sweat; capable of 30p recording and playback via HDMI® and compatible HDTV \nShare your footage in a snap via Wi-Fi-enabled mobile phones and tablets running the free PlayMemories Mobile™ application \nSelect the clips and the camera will transfer and compress web-optimized movies and photos without a single cable; then share your cuts on the web and social media apps Whether you're mountain biking, skiing, skateboarding or surfing, SteadyShot® image stabilization and Active Mode deliver stunningly smooth wide-angle to telephoto video \nTurn on the shake canceling mode for added electronic stability and even smoother video capture \nSony Action Cam ships with 2 adhesive, quick-connect mounts; optional accessories from Sony (not included) let you mount the Action Cam just about anywhere you can imagine",
