        "productName": "Thule Transporter - Combi Hitch",
        "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">No step stool required! This Thule Transporter cargo box mounts to your hitch, not your rooftop, making it easy to access all your gear.</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Tilt-down design offers quick and easy access to the rear of your vehicle</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Comes complete with 1.25 and 2 in. receiver hitch adapters for added versatility</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Includes Thule's One Key System® and 4-pin pre-wired taillights</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Also includes LPA license plate adapter so you're still street legal</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Carrying capacity is a hefty 165 lbs.</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Requires 1.25 or 2 in. receiver hitch, Class II or higher</span><br></li></ul></div>",
