        "localeCode": "en-US",
        "productName": "Thule M.O.A.B. Basket",
        "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">The Thule M.O.A.B basket is built for the outdoor adventurer's lifestyle. Just pack your bags, bikes, boat and the kitchen sink—there's room for everything!</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">M.O.A.B. refers to the Mother Of All Baskets—perfectly sized to fit on 4x4s, SUVs and wagons</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Load Bars adjust to allow attachment of bike, ski and watersport carriers</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Completely redesigned hub system ensures quick, hassle-free assembly</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Easy to install with quick on/off mounting hardware</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Custom fairing reduces wind noise while providing a finished look</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Weatherproof, smooth black finish</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Deter tampering by adding 4 Keyed-Alike Locks, sold separately</span><br></li></ul></div>",
        "productShortDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">The Thule M.O.A.B basket is built for the outdoor adventurer's lifestyle. Just pack your bags, bikes, boat and the kitchen sink—there's room for everything!</font></div>",
