        "productName": "Yakima DoubleDown Ace Hitch Rack - 4 Bike",
        "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">The Yakima DoubleDown Ace 4 bike rack gives you the best of both worlds by safely transporting up to 4 bikes, and then providing easy access to your vehicle.</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Installation to vehicle is a breeze and requires no tools; rack locks to hitch for security</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Once bikes are removed, tilt-down mast lowers rack out of the way to provide access to back of vehicle</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Fits most bikes, but an adapter (sold separately) may be required for women’s or kids’ bikes; not designed for use with tandem or recumbent bikes</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Anti-sway bike cradles eliminate bike-to-bike contact and bike-to-vehicle contact</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Rubber straps on each cradle securely anchor bike into place</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Cradle arms can be lowered when not in use</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Intuitive levers with anti-pinch trigger covers make folding cradle arms and mast a simple endeavor</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Fits 1.25 in. and 2 in. receiver hitches; designed for Class II hitches and higher</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Includes a hitch lock to lock rack onto your hitch</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">DoubleDown Ace 4 bike rack has 2 integrated bottle openers—1 at the end of each arm</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Not intended for tandem or recumbent bikes; carrying bikes with step-through frames requires the purchase of an adapter (sold separately)</span><br></li></ul></div>",
