        "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">Thule introduces the Raceway 2-bike trunk rack aimed at easy installation and even easier loading for up to 2 bikes.</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Rack comes preassembled with 4 attachment straps (with vinyl coated steel cables) to secure the rack to your vehicle</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Injection-molded nylon and extruded aluminum frame construction is lightweight yet superstrong; molded rubber pads at contact points protect vehicle</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">No Sway Cage™ anti-sway device prevents bike-to-bike contact</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Oversize, easy-to-grip ratcheting knobs make mounting and adjusting bike rack practically hassle free</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Narrow cradle arm design will accommodate most bicycle frame designs including smaller child bike frames; bike arms fold down when not in use</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Easily fits a wide range of vehicle styles: sedans, hatchbacks and minivans; compatible with most factory spoilers</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Thule Raceway 2 bike trunk rack weighs 20 lbs.</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Not intended for tandem or recumbent bikes; carrying bikes with step-through frames requires the purchase of an adapter (sold separately)</span><br></li></ul></div>",
        "productShortDescription": "<span style=\"font-size: medium; \">Thule introduces the Raceway 2-bike trunk rack aimed at easy installation and even easier loading for up to 2 bikes.</span>",
