      "localeCode": "en-US",
      "productName": "Thule Hullavator",
      "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">Thule® is always looking to raise the bar, but this time they've lowered it!</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">This kayak lift system brings the load platform down and enables anyone to load and unload a kayak</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Reduces lift height required to load and unload a kayak by 40 inches</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Reduces effort required to lift boat with gas-assist shocks that help raise the boat onto the vehicle roof</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">No need to reach top of vehicle to secure boat; strap it while in the down position</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Integrated padded support protects boat surface</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Lift system only requires approximately 25 inches of load bar space for mounting, leaving room for other accessories</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Fits Thule and Yakima load bars</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Includes lift system, integrated padded support, mounting hardware and all straps necessary to transport one kayak</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Locks to load bar, (locks sold separately)</span><br></li></ul></div>",
