        "productName": "Yakima BowDown Kayak Rack",
        "productFullDescription": "<div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\">Taking J-cradles to the next level, the Yakima BowDown has all the features you've been looking for in a kayak rack!</font></div><div><font face=\"SourceSansProRegular, helvetica, arial, verdana, sans-serif\" size=\"3\"><br></font></div><div><ul><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Cradle arms fold down when not in use—now you don't have to worry about parking garages with limited clearance</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Accommodates most hull shapes; cradles and protects your kayak with soft pads</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Because kayak is propped up on its side, it leaves more space on your crossbars for other gear</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Universal mounting hardware fits round, square and most factory bars</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Includes heavy-duty straps with padded buckles for secure transport; also includes bow and stern tie-down straps</span><br></li><li><span style=\"font-family: SourceSansProRegular, helvetica, arial, verdana, sans-serif; font-size: medium;\">Locks to crossbar with SKS lock core system (sold separately)</span><br></li></ul></div>",
